const imgBase64 = ``

document.getElementById('image').src = `data:image/jpeg;base64,${imgBase64}`;


const fileUploader = document.querySelector('#file-uploader');

const toBase64 = file => new Promise((resolve, reject) => {
  const reader = new FileReader();
  reader.readAsDataURL(file);
  reader.onload = () => resolve(reader.result);
  reader.onerror = error => reject(error);
});
fileUploader.addEventListener('change', async (e) => {

  // console.log(e.target.files[0]); // get file object
});



const postImage = async () => {
  const file = await toBase64(fileUploader.files[0]);
  const image1 = file.split(",")[1];
  console.log(image1);
  axios.post(`http://localhost:5000/store`, {
    image1
  })
    .then((response) => {
      var dataObject = response.data;
      // POST success
      console.log(dataObject);

    },
      (error) => {
        var message = error.response.data.message;
      }
    );
}
